import React from "react";

import C from "../Images/c.png"
import Cs from "../Images/c.png"
import Cpp from "../Images/c.png"
import Css from "../Images/c.png"
import html from "../Images/c.png"
import js from "../Images/c.png"
import react from "../Images/c.png"
import redux from "../Images/c.png"
import typescript from "../Images/c.png"
import python from "../Images/c.png"

const Skills: React.FC<{}> = ({}) => {
  return (
    <div className="mx-auto px-32 my-14">
      <div className="font-bold text-black text-4xl py-4">My Skills</div>
      <div className="flex">
        <C />
        <Cs />
        <Cpp />
        <Css />
        <html />
        
      </div>
    </div>
  );
};

const SkillBox: React.FC<{name: string, image: string}> = ({name, image}) => {
  return (
    <div>
      <img src={require(image)} alt={name}/>
      <div>{name}</div>
    </div>
  )
}

export default Skills;
